To store data locally using AsyncStorage in Expo SDK 54, follow these steps:


**1. Installation:**

First, install the `@react-native-async-storage/async-storage` package in your Expo project:


```bash
npx expo install @react-native-async-storage/async-storage


```


**2. Core Methods for Storing and Retrieving Data:**

AsyncStorage provides an asynchronous, unencrypted, key-value storage system. Remember to `JSON.stringify()` complex data types (objects, arrays) before storing and
 `JSON.parse()` them upon retrieval.

*   **`setItem(key, value)`**: Stores data.


```javascript
    import AsyncStorage from '@react-native-async-storage/async-storage';

    const storeData
 = async (key, value) => {
      try {
        await AsyncStorage.setItem(key, JSON.stringify(value));
        console.log(`Data stored with key ${key}`);
      } catch (error)
 {
        console.error('Error storing data:', error);
      }
    };

    // Example usage:
    storeData('userName', 'John Doe');
    storeData('userSettings', { theme: 'dark',
 notifications: true });

```


*   **`getItem(key)`**: Retrieves data.


```javascript
    import AsyncStorage from '@react-native-async-storage/async-storage';

    const retrieveData =
 async (key) => {
      try {
        const value = await AsyncStorage.getItem(key);
        if (value !== null) {
          const parsedValue = JSON.parse(value);
          console.log(`Data
 retrieved for key ${key}:`, parsedValue);
          return parsedValue;
        } else {
          console.log('No data found for the given key.');
          return null;
        }
      } catch (
error) {
        console.error('Error retrieving data:', error);
        return null;
      }
    };

    // Example usage:
    retrieveData('userName');
    retrieveData('userSettings');


```


*   **`removeItem(key)`**: Deletes data for a specific key.


```javascript
    import AsyncStorage from '@react-native-async-storage/async-storage';

    const removeData =
 async (key) => {
      try {
        await AsyncStorage.removeItem(key);
        console.log(`Data with key ${key} removed successfully.`);
      } catch (error) {
        console.error('
Error removing data:', error);
      }
    };

    // Example usage:
    removeData('userName');

```


*   **`clear()`**: Deletes all items from AsyncStorage.


```javascript

    import AsyncStorage from '@react-native-async-storage/async-storage';

    const clearAllData = async () => {
      try {
        await AsyncStorage.clear();
        console.log('All data cleared
 from AsyncStorage.');
      } catch (error) {
        console.error('Error clearing AsyncStorage:', error);
      }
    };

    // Example usage:
    clearAllData();

```


**3. Other Local
 Storage Options in Expo SDK 54:**

For different use cases, consider these alternatives:

*   **`expo-secure-store`**: For sensitive data requiring encryption (e.g., authentication tokens).
*   **`expo-
file-system`**: For larger files or direct file management.
*   **`expo-sqlite`**: For larger, relational datasets.

